import React, { useEffect, useState } from 'react'

const ViewQuestion = () => {

    const [question,setQuestion]=useState("")

  useEffect(()=>{
    fetchCall();
  },[]);

    function fetchCall(){
const res=fetch('https://localhost:8443/onlineexamapplication/control/viewQuestions')
     const data=res.json();
      setQuestion(data)
    }
    console.log(question)
  return (
    <>
    {question}
    
    </>
  )
}

export default ViewQuestion
